import React, { useState } from "react";
import TextField from "@material-ui/core/TextField";
import FormControl from "@material-ui/core/FormControl";
import FormLabel from "@material-ui/core/FormLabel";
import Checkbox from "@material-ui/core/Checkbox";
import FormControlLabel from "@material-ui/core/FormControlLabel";
import Radio from "@material-ui/core/Radio";
import RadioGroup from "@material-ui/core/RadioGroup";
import Button from "@material-ui/core/Button";
import "./FormDetail.css";
import * as yup from "yup";

export default function FormDetail() {
  const [checked, setChecked] = useState({
    travelling: false,
    music: false,
    playing: false,
    reading: false,
  });

  const [data, setData] = useState({
    name: "",
    email: "",
    phone: "",
    gender: "",
    hobbies: "",
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(data);
  };

  const validationSchema = yup.object().shape({
    name: yup.string().min(2, "To short").required("Enter your name"),
    email: yup
      .string()
      .email("Enter your email")
      .required("Enter your email address"),
    phone: yup
      .number()
      .typeError("Cannot Contain Letters")
      .required("Enter phone number"),
    gender: yup.string().required("Choose your gender"),
    hobbies: yup.string().required("Choose your hobbies"),
  });

  return (
    <form
      onSubmit={handleSubmit}
      className="form-group"
      validationSchema={validationSchema}
    >
      <TextField
        value={data.name}
        id="standard-basic"
        label="Name"
        onChange={(e) => {
          setData({ ...data, name: e.target.value });
        }}
      />
      <TextField
        id="standard-basic"
        label="Email"
        type="email"
        onChange={(e) => {
          setData({ ...data, email: e.target.value });
        }}
      />
      <TextField
        id="standard-basic"
        label="Number"
        type="numeric"
        onChange={(e) => {
          setData({ ...data, phone: e.target.value });
        }}
      />

      <FormControl
        style={{ marginTop: "15px" }}
        className="forgenders"
        component="fieldset"
      >
        <FormLabel component="legend">Gender</FormLabel>
        <RadioGroup
          name="gender"
          aria-label="gender"
          style={{ display: "initial" }}
          onChange={(e) => {
            setData({ ...data, gender: e.target.value });
          }}
        >
          <FormControlLabel value="female" control={<Radio />} label="Female" />
          <FormControlLabel value="male" control={<Radio />} label="Male" />
          <FormControlLabel value="other" control={<Radio />} label="Other" />
        </RadioGroup>
      </FormControl>

      <label>Hobbies</label>
      <div className="hobbiesA">
        <Checkbox
          checked={checked.reading}
          onChange={(event) => {
            setChecked({ ...checked, reading: event.target.checked });
          }}
          inputProps={{ "aria-label": "primary checkbox" }}
        />
        <label>Reading</label>
        <Checkbox
          checked={checked.playing}
          onChange={(event) => {
            setChecked({ ...checked, playing: event.target.checked });
          }}
          inputProps={{ "aria-label": "primary checkbox" }}
        />
        <label>Playing Football</label>
      </div>
      <div className="hobbiesB">
        <Checkbox
          checked={checked.travelling}
          onChange={(event) => {
            setChecked({ ...checked, travelling: event.target.checked });
          }}
          inputProps={{ "aria-label": "primary checkbox" }}
        />
        <label>Travelling</label>

        <Checkbox
          checked={checked.music}
          onChange={(event) => {
            setChecked({ ...checked, music: event.target.checked });
          }}
          inputProps={{ "aria-label": "primary checkbox" }}
        />
        <label>Listening Music</label>

        <Button
          type="submit"
          variant="contained"
          color="primary"
          className="button"
        >
          Submit
        </Button>
      </div>
    </form>
  );
}
